import React from 'react'
import { useState } from 'react'


export default function Inscritpion() {
  const [fullname, setfullname] = useState(" ");
  const [email, setemail] = useState(" ");
  const [password, setpassword] = useState(" ");

  const valueFullname = (event)=>{
    setfullname(event.target.value);
  }

  const valueEmail = (event)=>{
    setemail(event.target.value);
  }

  const valuePassword = (event)=>{
    setpassword(event.target.value);
  }

  const handleSubmit = (event) =>{
    event.preventDefault();
  }

  return (
    <div>
        <form onSubmit={handleSubmit}>
            <input type="text" placeholder="fullname" onChange={valueFullname}/>
            <input type="text" placeholder="email" onChange={valueEmail}/>
            <input type="text" placeholder="password" onChange={valuePassword}/>
            <button>valider</button>
        </form>
    </div>
  )
}
